import {Routes,Route } from 'react-router-dom';
import './App.css';
import Home from './Component/Home';
import Navbar from './Component/Navbar';
import Login from './Component/Login';
import Sinup from './Component/Sinup';
import Newdata from './Component/Context/Updatecontext'
import UpdateAlert from './Component/Context/UpdateAlert';
import Alerts from './Component/Alert';
import Showuserdata from './Component/Usedata/Showuserdata';
function App() {
  return (
    <>
      <Newdata>
        <UpdateAlert>
        <Navbar/>
        <Alerts/>
      <Routes>
        <Route path='/' element={<Home/>}></Route>
        <Route path='/olddata' element={<Showuserdata/>}></Route>
          <Route path='/login' element={<Login/>}/>
          <Route path='/sinup' element={<Sinup/>}></Route>
    </Routes>
    </UpdateAlert>
    </Newdata>
    </>
  );
}

export default App;
